import React from "react"

class App extends React.Component{

    constructor(){
        super();
        this.user.loggedIn = true;
    }
    render(){
        let userLogged;
        if(this.user.loggedIn){
            userLogged = Yes;
        }
        else
            userLogged = No
        return (
            <h1>User logged {userLogged} </h1>
        )


    }
}


export default App
